import React, { useState } from "react";
import "./SearchPage.css";

const SearchPage: React.FC = () => {
  const [query, setQuery] = useState("");

  const handleSearch = () => {
    console.log("검색어:", query);
  };

  return (
    <div className="search-container">
      {/* 검색 박스 */}
      <div className="search-box">
        <input
          type="text"
          placeholder="검색어를 입력하세요..."
          value={query}
          onChange={(e) => setQuery(e.target.value)}
        />
        <button onClick={handleSearch}>검색</button>
      </div>

      {/* 검색 결과 */}
      <div className="results-grid">
        <div className="results-column">
          <h2>텍스트 → 텍스트 결과</h2>
          <div className="result-card">결과 1</div>
          <div className="result-card">결과 2</div>
          <div className="result-card">결과 3</div>
        </div>
        <div className="results-column">
          <h2>텍스트 → 이미지 결과</h2>
          <div className="result-card">이미지 결과 1</div>
          <div className="result-card">이미지 결과 2</div>
          <div className="result-card">이미지 결과 3</div>
        </div>
      </div>
    </div>
  );
};

export default SearchPage;
